      .panel-animation {
        animation: panelAnimation;
        animation-duration: 0.5s;
        animation-iteration-count: initial;
        animation-fill-mode: forwards;
      }

      @keyframes panelAnimation {
        0% {
          left: -55vw;
        }
        100% {
          left: 0;
        }
      }

      .blur {
        filter: blur(8px);
        -webkit-filter: blur(8px);
      }

      .unblur {
        animation: unblurAnimation;
        animation-duration: 0.5s;
        animation-iteration-count: initial;
        animation-fill-mode: forwards;
      }

      .background-great-animation {
        animation: backgroundGreatAnimation;
        animation-duration: 1s;
        animation-iteration-count: initial;
      }

      @keyframes backgroundGreatAnimation {
        0% {
          filter: brightness(1);
        }
        50% {
          filter: brightness(2);
        }
        100% {
          filter: brightness(1);
        }
      }

      @keyframes unblurAnimation {
        0% {
          filter: blur(8px);
          -webkit-filter: blur(8px);
        }
        100% {
          filter: blur(0);
          -webkit-filter: blur(0);
        }
      }

      .star-animation {
        animation: starAnimation;
        animation-duration: 0.3s;
        animation-iteration-count: initial;
      }

      @keyframes starAnimation {
        0% {
          transform: scale(10, 10);
        }

        100% {
          transform: scale(1, 1);
        }
      }

      #great {
        position: absolute;
        background-size: cover;
        background-repeat: no-repeat;
        width: 66vw;
        height: 17vw;
        top: 80vw;
        left: 20vw;
        opacity: 0;
      }

      .great-animation {
        animation: greatAnimation;
        animation-duration: 0.5s;
        animation-iteration-count: initial;
      }

      @keyframes greatAnimation {
        0% {
          transform: scale(10, 10);
        }
        100% {
          transform: scale(1, 1);
        }
      }

      .scene-transtion-animation {
        animation: sceneTranstionAnimation;
        animation-duration: 0.5s;
        animation-iteration-count: initial;
        animation-fill-mode: forwards;
      }

      @keyframes sceneTranstionAnimation {
        100% {
          left: -100vw;
        }
      }

    <script>
      if (mraid.getState() === "loading") {
        mraid.addEventListener("ready", onSdkReady);
      } else {
        onSdkReady();
      }

      function viewableChangeHandler(viewable) {
        if (viewable) {
          // showAdd();
          music.play();
        } else {
          // pause
          music.pause();
        }
      }

      function onSdkReady() {
        mraid.addEventListener("viewableChange", viewableChangeHandler);
        // Wait for the ad to become viewable for the first time
        if (mraid.isViewable()) {
          start();
        }
      }

        const container = document.getElementById("container");

        const greatElements = [star1, star2, star3, great];

        let isStarted = false;

        music.volume = 0.5;
        music.addEventListener("timeupdate", function () {
          const buffer = 0.44;
          if (this.currentTime > this.duration - buffer) {
            this.currentTime = 0;
            this.play();
          }
        });

        const playSound = (id) => {
          const audio = document.getElementById(id);
          audio.currentTime = 0;
          audio.play();
        };

        const viewElement = (element, hide) => {
          if (hide) {
            element.classList.add("hide");
          } else {
            element.classList.remove("hide");
          }
        };

        const changeAnimation = (object, firstAnimation, secondAnimation) => {
          object.classList.remove(firstAnimation);
          object.classList.add(secondAnimation);
        };

        const showAd = () => {
          const showStars = () => {
            viewElement(star1, false);
            playSound("star-pop");
            star1.addEventListener("animationend", () => {
              viewElement(star3, false);
              playSound("star-pop");
            });
            star3.addEventListener("animationend", () => {
              viewElement(star2, false);
              playSound("star-pop");
            });
            star2.addEventListener("animationend", () => {
              viewElement(great, false);
            });
          };

          const hideStars = () => {
            greatElements.forEach((element) => {
              viewElement(element, true);
            });
          };

          const startAd = () => {
            if (isStarted == false) {
              viewElement(hand, true);
              viewElement(tapToFind, true);
              playSound("impact");
              changeAnimation(background, "blur", "unblur");
              changeAnimation(donut, "blur", "unblur");
              donut.classList.add("object-animation");
              changeAnimation(findADonut, "hide", "find-text-animation");
              viewElement(panel, false);
              findADonut.addEventListener("animationend", () =>
                viewElement(findADonut, true)
              );
              music.play();
            }
            isStarted = true;
          };

          const firstSceneEnd = () => {
            playSound("wow");
            playSound("bell");
            changeAnimation(
              donut,
              "object-animation",
              "animation-founded-donut"
            );
            container.classList.add("background-great-animation");
            showStars();
            great.addEventListener("animationend", firstSceneTranstion);
          };

          const firstSceneTranstion = () => {
            background.classList.add("scene-transtion-animation");
            hideStars();
            viewElement(background2, false);
            viewElement(lollypop, false);
            container.classList.remove("background-great-animation");
            viewElement(findALollypop, false);
            playSound("impact");
            lollypop.addEventListener("animationend", () => {
              changeAnimation(
                lollypop,
                "lollypop-appears-animation",
                "object-animation"
              );
            });
            findALollypop.addEventListener("animationend", () =>
              viewElement(findALollypop, true)
            );
          };

          const secondSceneEnd = () => {
            playSound("wow");
            playSound("bell");
            changeAnimation(
              lollypop,
              "object-animation",
              "lollypop-founded-animation"
            );
            container.classList.add("background-great-animation");
            showStars();
            great.removeEventListener("animationend", firstSceneTranstion);
            great.addEventListener("animationend", secondSceneTranstion);
          };

          const secondSceneTranstion = () => {
            changeAnimation(
              background2,
              "background-animation",
              "scene-transtion-animation"
            );
            viewElement(background3, false);
            container.classList.remove("background-great-animation");
            hideStars();
            viewElement(capcake, false);
            playSound("impact");
            viewElement(findACapcake, false);
            capcake.addEventListener("animationend", () => {
              changeAnimation(
                capcake,
                "capcake-appears-animation",
                "object-animation"
              );
            });
            findACapcake.addEventListener("animationend", () =>
              viewElement(findACapcake, true)
            );
          };

          const thirtSceneEnd = () => {
            playSound("bell");
            playSound("applause");
            playSound("laugh");
            changeAnimation(
              capcake,
              "object-animation",
              "capcake-founded-animation"
            );
            container.classList.add("background-great-animation");
            viewElement(button, false);
            viewElement(logo, false);
          };

          const buttonHandler = () => {
            var userAgent = navigator.userAgent || navigator.vendor;
            var url =
              "https://apps.apple.com/us/app/hidy-find-hidden-objects/id1548950491?itsct=apps_box_link&itscg=3020";
            var android =
              "https://play.google.com/store/apps/details?id=gg.hidy";
            if (/android/i.test(userAgent)) {
              url = android;
            }
            mraid.open(url);
          };

          button.addEventListener("click", buttonHandler);
          container.addEventListener("click", startAd);
          donut.addEventListener("click", firstSceneEnd);
          lollypop.addEventListener("click", secondSceneEnd);
          capcake.addEventListener("click", thirtSceneEnd);
        };

        showAd();
      };
    </script>
  </body>
</html>
